        else -> Camera1Enumerator()
    }, videoDecoderFactory: VideoDecoderFactory = DefaultVideoDecoderFactory(eglBase.eglBaseContext), videoEncoderFactory: VideoEncoderFactory = DefaultVideoEncoderFactory(
